import App from "./App";
import { createRoot } from "react-dom/client";
import { createBrowserRouter, RouterProvider } from "react-router-dom";
import { AllData } from "./Data/AllData";
import AllAbout from "./About/AllAbout";
import AllMenu from "./Menu/AllMenu";
import AllTestimonials from "./Testimonials/AllTestimonials";
import AllContact from "./Contact/AllContact";
import ReservationsDashboard from "./Dashboard/ReservationsDashboard";

const router = createBrowserRouter([
  {
    path: "/",
    element: <App />,
  },
  {
    path: "about",
    element: <AllAbout />,
  },
  {
    path: "menu",
    element: <AllMenu />,
  },
  {
    path: "testimonials",
    element: <AllTestimonials />,
  },
  {
    path: "contact",
    element: <AllContact />,
  },
  {
    path: "/dashboard/reservations",
    element: <ReservationsDashboard />,
  },
]);

createRoot(document.getElementById("root")).render(
  <AllData>
    <RouterProvider router={router} />
  </AllData>
);
